export default async function postSearch (data) {
    const response = await fetch( "http://localhost:4000/search", {
      method: 'POST',
      mode: 'cors',
      cache: 'no-cache',
      headers: {
        'Content-Type': 'application/json'
      },
      body: JSON.stringify(data)
    })
    return response.json()
}
